import logo from './logo.svg';
import './App.css';

function App() {
const[directors, setDirectors] = 
  useEffect(()=>{
    //FetchDirectors
    fetch("https://localhost:7125/api/Directors")
    .then(response=>response.json())
    .then(data=>{
      setDirectors(data)
      console.log(data)
    })
  })

  return (
    <div className="App">
      <header className="App-header">
          <h1></h1>
      </header>
    </div>
  );
}

export default App;
